(1, 'a-reasonable-man', 'A REASONABLE MAN', '<p>NARRATIVE SHORT</p><p>When a European expatriate leaves a Beijing private party with a secret, he comes up with a foolproof way to ensure it is not compromised.</p><p>26 minutes</p><p><i>In English and Mandarin, with English and Mandarin subtitles available. Starring: Hannes Wegener, Jueman Yang, Edmund Digby-Jones, Xiao Hou.</i></p><p><a href=\"http://www.sydneyribot.com/demo/projects/a-reasonable-man.html#\"></a></p><footer><p><a href=\"http://uexel.com/\" target=\"_blank\"></a></p></footer><p>video available on request.</p>', '', 2, 'http://sydneyribot.com/storage/web/source', '1/JwaysF9a4BSKY66n35h5aZ-m_vhvKcLk.jpg', 'http://sydneyribot.com/storage/web/source', '1/DEsarPUdB_rnrR6S6MGi5v8uMhV3iA6w.jpg', 1, 1, 1, 1525325408, 1525325408, 1525432661, 26, 0, 2018, 0, '', 0),
(2, 'we-all-have-our-double-cross-to-bear', 'WE ALL HAVE OUR DOUBLE-CROSS TO BEAR', '<p>Publication: The Rumpus (USA)</p><p>280 words</p><h1>SATURDAY</h1><p>When Muhammad went out Friday night, you could say life was on his ass. He’d followed a girl to Istanbul only to find she was homesick for Nebraska cornfields and beer in red Solo cups. (‘But habibti, I will buy you plastic glasses. I thought only you wanted glass ones,” he had told her to no avail). His flatmate hadn’t paid the power bill, and his house in Aleppo was no longer a home. It wasn’t even a house. Assad had bombed the shit out of it, and ISIS was fighting for the scraps. To top it off, he had tried to cancel his Turkish landline and wound up owning three, with a TV subscription comprised primarily of daytime marriage programs and late-night conspiracy talk shows thrown in – “for friendship.”</p><p>Muhammad didn’t own a television.</p><p>He figured he’d better stay in Istanbul, not least because he couldn’t go back to Syria (the official term was ‘refugee’), but what better time than the present to become a journalist? These days, his parents didn’t have time to nag him into finishing his business degree. With English fine-tuned by his paramour, Muhammad could skip Istanbul altogether. He could go to Europe. Maybe even New York. Or Nebraska</p><p>To continue reading, contact info@sydneyribot.com or purchase a hard copy of the magazine.</p><p><img src=\"http://localhost/sydneycms/storage/web/source/1/uWQW4a4pu49R-eqPQEpGq8-qm4s9fT8n.png\"></p>', '', 3, 'http://sydneyribot.com/storage/web/source', '1/qDOk9wluKomE8jTFRPr8WMCzdVkGmTKW.jpg', 'http://sydneyribot.com/storage/web/source', '1/LE0GcbJkwZzJnfFHfprhHDQ8BWjOtWJL.jpg', 1, 1, 1, 1525325532, 1525325532, 1525432347, 0, 0, 2017, 280, '', 0),
(3, 'gazi', 'GAZI', '<p>NARRATIVE SHORT</p><p>An aging patriarch makes a desperate play at relevance during a family dinner.</p><p>4 minutes</p><p><i>In Turkish, with English subtitles. Starring: Cezmi Baskin, Aliye Uzunatagan, Merve Dizdar, Ali Ayaz, Melis Tüzün, Görkem Yeltan, Tonguç Dikme</i></p><p>video available on request</p>', '', 2, 'http://sydneyribot.com/storage/web/source', '1/V5sISjifEZrp91OM1d62k_r0-qUcxDmR.jpg', 'http://sydneyribot.com/storage/web/source', '1/-NtkOgeXnAb13ujNW1B4beaKJjkaRs8M.jpg', 1, 1, 1, 1525325679, 1525325679, 1531869213, 4, 0, 2017, 0, '', 0),
(4, 'letter-from-istanbul-no-time-for-tourists', 'LETTER FROM ISTANBUL: NO TIME FOR TOURISTS', '<p>Publication: The White Review (UK)</p><p>2,400 words</p><h1>SATURDAY</h1><p>ON MARCH 19, AT 1 P.M. IN A CAFÉ OFF TURNACIBA?I St., an Italian man could be seen summoning the courage to ask two women if he could take their picture. Like most Istanbullus in Beyo?lu then, we were making fevered use of our phones. ‘I suppose so,’ my friend looked up, ‘but I’m a bit hungover.’ Even with dirty hair, she was radiant enough to make anyone invent excuses for a longer look.</p><p>It was a Saturday. The man said he was a journalist. Four hundred metres away, limbs were strewn over European Istanbul’s main shopping street. Ninety minutes ago, someone blew himself up on Istiklal, but that wasn’t why the man was asking. He didn’t know Raja looked distressed for someone who counseled activists in countries that pitched on the waves of foreign opportunism and domestic corruption. He couldn’t know that, poised as she was, it was not unthinkable that she would rather credit her fraying composure to intemperance than shock at the government’s crumbling security façade. He just pulled his Nikon D300 off the table and started fiddling with the settings.</p><p>For the first time in three years, surveillance helicopters flew over the neighbourhood.</p><p>The Turkish language differentiates starkly between past events we have witnessed and those whose existence comes to us by hearsay. Events reported by others are distinguished by adding –mI? to the end of the verb or nominal clause. ‘Ben seni sevdi?imi dünyalara bildirdim,’ the first line in a Black Sea folk song made famous by Kaz?m Koyuncu, means ‘I let the world know that I love you.’ It happened, and I know because I told everyone. Moreover, I did the thing. ‘Ben sana doyamad?m,’ the song’s final line begins: ‘I couldn’t get enough of you.’ These are emotional certainties. There is no temporal or physical distance between their occurrence and my knowledge of them.</p><p>At the other pole of perception are actions that not only did we not execute, but which we did not see or hear. That you heard (‘sen duymu?sun’) of my betrayal through gossip because we ‘seem to have fallen on the tongue of the neighbourhood’ (‘mahallenin diline dü?mü?üz’) is shrouded in –mI?’s speculative smog. I was not present for the transmission of this piece of information and as such, I cannot confirm its veracity with confidence – even if it seems to have had a clear outcome. In the Turkish Republic, we tireless youth prefer to see things with our own eyes. Knowing government IT monitors would soon handicap news sources by slowing social media, some friends had gone to peek past police barricades at the carnage. Fearful that this explosion would precede a bigger one, Raja and I stayed behind.</p><p>The writing had been on the wall, but Saturday apprised Turkey’s cultural capital that its immunity to the consequences of state schizophrenia was over. In the past year, the government had joined the coalition against Isis, continued to pursue a domestic war against Kurds it had been enfranchising for a decade, shot down a Russian jet, and accepted three billion euros from the EU to stop the Middle East from coming to Europe. After shunning Israel since a deadly maritime dispute in 2010 over Gaza’s blockade, President Erdo?an publicly reached out to Netanyahu for support. Turkey was officially on bad terms with its neighbours. The food Raja had ordered for everyone went uneaten.</p><p>In conflict zones, almost any photograph can be justified as testimony. We consider pictures of young mothers in Jordanian refugee camps clutching babies to be socially important. History will absolve us of our voyeurism, we assure ourselves as we witness the woman’s unjust circumstances and marvel at her turn as an avatar of perseverance. Turkey is on so many travel warning lists these days, the man could almost have gotten away with photographing us sans excuse – but Istanbul was not a war zone yet, we told ourselves, and so I asked him what his aim was. As I had come to Turkey to make narrative films, I was especially curious about the intention behind his framing</p><p>Sheepishly, he adjusted his glasses. ‘The story is supposed to be about women’s issues in Turkey, their situation, and now,’ he shrugged, ‘this.’ For a story about women, he asked us nothing. As we were not even Turks, I wondered what he was going to do with his stock photos of ‘liberated’ foreigners. We were not demure enough to reward this morning’s martyr in Jannah. Would he attach us to an article on covered women in Çar?amba?</p><p>As he shuffled into the street, I saw the photo of Raja and me on his camera display. He had overexposed us so much we didn’t even look like ourselves.</p><h1>SUNDAY</h1><p>Humanitarian crises attract artists the way MIT industry funding draws engineers. Sunday morning, Ai Weiwei came from China to interview Raja about activism and self-representation for a documentary on refugees. It’s all about the selfie, he says. It is proof – for some people, the first – that they exist. Ai Weiwei is good at selfies. He takes them liberally and sheds them on social media like superfluous skin. The photo he took of his interviewee garnered 1,000 likes within an hour. He said if you give him two months and internet, he could start a revolution. The run-and-gun film kit his crew used looked tough enough to withstand one.</p><p>After lunch, an Afghan-American writer went to Sultanahmet Square to wait for Ai...</p><p>To continue reading,<a href=\"http://www.thewhitereview.org/feature/postcard-from-istanbul-no-time-for-tourists/\">click here</a>.</p>', '', 5, 'http://sydneyribot.com/storage/web/source', '1/AD5epHXTgOGM1oXj29yA5NUKOUDoOxMp.jpg', 'http://sydneyribot.com/storage/web/source', '1/34ZwFjuOrw7JDURbL3DS0KRHXOgJuRUb.jpg', 1, 1, 1, 1525325822, 1525325822, 1525432460, 0, 0, 2016, 2400, '', 0),
(5, 'bazaar-protocol', 'BAZAAR PROTOCOL', '<p>NARRATIVE SHORT</p><p>13 minutes</p><p><i>In Turkish and Russian, with English subtitles. Starring: Terrence Colby Clemons, Anastasia Laukkanen, Cemil Hamzaoglu, Özgür Emre Yildirim</i></p><p>When an American man visiting Istanbul answers a shoe salesman in Russian, the unexpected language overlap gives them the impression they are on the same page.</p><p>video available on request</p>', '', 2, 'http://sydneyribot.com/storage/web/source', '1/QPTyAm3UbetbErRH9l2h45b8GPyqy3mV.jpg', 'http://sydneyribot.com/storage/web/source', '1/dJb6AH2w5NJNX39PH6Iq6W8-Gu2twFrr.jpg', 1, 1, 1, 1525326022, 1525326022, 1531869253, 13, 0, 2016, 0, '', 0),
(6, 'opportunists', 'OPPORTUNISTS', '<p>Opportunists is the director\'s attempt to provide a portrait of the world\'s biggest intercontinental trading hub--Istanbul, Turkey--through a series of interviews with foreigners living there. Microcosm and metaphor for an increasingly globalized world, Istanbul is exposed in ways few other cities are. And it exposes people.</p><p>Opportunists asks its subjects: what is it like to walk around in that body of yours, here, in this place, at this time?</p><h1>SAJID</h1><p>A material scientist talks about lying to ourselves, mobile snatching probabilities in Karachi, beards, and the fine line between hipster style and being mistaken for a religious fundamentalist.</p><p><br></p><iframe src=\"https://player.vimeo.com/video/163810201?byline=0&portrait=0\" width=\"640\" height=\"352\" frameborder=\"0\" webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\"></iframe><h1>ANASTASIA</h1><p>A Russian environmentalist talks about home delivery, loneliness, language, and trying to get things done in Istanbul.</p><iframe src=\"https://player.vimeo.com/video/164467978?byline=0&portrait=0\" width=\"640\" height=\"352\" frameborder=\"0\" webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\"></iframe><h1>MARIA</h1><p>A Greek-American writer talks about fate, urban planning, collective identity formation, the limits of Hellenism, and how you can literally miss history by being on an island.</p><p><iframe src=\"https://player.vimeo.com/video/204453594?title=0&byline=0&portrait=0\" width=\"640\" height=\"352\" frameborder=\"0\" webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\"></iframe></p>', '', 4, 'http://sydneyribot.com/storage/web/source', '1/7nJnrP0t8Fl7glKWTS6WsumXWc-gMyLf.jpg', 'http://sydneyribot.com/storage/web/source', '1/qtVnK7mByzeY3Wq24944fr8aObJ_6dRe.jpg', 1, 1, 1, 1525326530, 1525326530, 1525432003, 0, 0, 2015, 0, '', 0),
(7, 'a-conditional-heart', 'A CONDITIONAL HEART', '<p>Publication: The Rumpus (USA)</p><p>280 words</p><h1>SATURDAY</h1><p>In college, Joey called me often to wring his hands. When I answered, I always said the same thing: I’d like to follow those thoughts of yours down their dark alleys so you can sit in the kitchen drinking lemonade and watching the dogs, but you won’t tell me their coordinates. I need to look for those places you can’t find if you’re not alone, you know?</p><p>As friends, we stewed in that paradox over tater tots and ketchup while he recovered from his humanities seminar. Biochem was his thing – biochem and fly-fishing. He didn’t trade in binaries, and he burned for it. He didn’t say he loved me, but he burst in my room at 5 one morning to put my hand on his chest. “You feel that?” he asked. It was thumping like a broken centrifuge. “My heart doesn’t beat like that for just anyone. Only you.” I thought I might kill him, but Joey marveled at his body’s truth. Pleased at the alliance between emotion and body, he smiled--breathless. After graduation, he called to wring his hands once more. His right ventricle had gone rogue, he said. He had passed out in graduate school. He had to get a defibrillator. He couldn’t safely raise his heart rate. “You remember those athletes who died after fainting? That’s what I’ve got.” A thought–a casualty of misfired memory cells–crossed my mind: perchance, it wasn’t me making his heart beat so fast years ago. By chance, the excitement could have killed him. “Remember freshman year?” I began to say, but he already knew: his heart wouldn’t beat like that for anyone else—he couldn’t risk it any more.</p>', '', 5, 'http://sydneyribot.com/storage/web/source', '1/bx0pQgsz3mZBnGjB3alJ389JDWgr8cvg.png', 'http://sydneyribot.com/storage/web/source', NULL, 1, 1, 1, 1525326645, 1525326645, 1525432591, 0, 0, 2015, 280, '', 0),
(8, 'the-question-game', 'THE QUESTION GAME', '<p>NARRATIVE SHORT</p><p>12 minutes</p><p><i>A sunburned northern European tries to please his Turkish girlfriend.</i></p><p>video available on request</p>', '', 2, 'http://sydneyribot.com/storage/web/source', '1/SkEBExHqoJN4jGkYSET9MGnlZaFzsciG.jpg', 'http://sydneyribot.com/storage/web/source', '1/cpq2fkK1kdi_3npnYX9ZLlye32LNC2fZ.jpg', 1, 1, 1, 1525326782, 1525326782, 1525432777, 12, 0, 2015, 0, '', 0);
